import React from 'react';
import { motion } from 'framer-motion';

const contactMethods = [
  {
    name: 'WhatsApp',
    description: 'Chat with us on WhatsApp',
    icon: 'üì±',
    link: 'https://wa.me/1234567890',
    color: 'bg-green-500'
  },
  {
    name: 'Messenger',
    description: 'Message us on Facebook',
    icon: 'üí¨',
    link: 'https://m.me/aiphotomagic',
    color: 'bg-blue-500'
  },
  {
    name: 'Email',
    description: 'Send us an email',
    icon: '‚úâÔ∏è',
    link: 'mailto:contact@aiphotomagic.com',
    color: 'bg-red-500'
  }
];

function Contact() {
  return (
    <div className="contact-section">
      <div className="contact-container">
        <motion.div
          className="contact-header"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h2>Contact Us</h2>
          <p>Have questions? We're here to help! Choose your preferred way to reach us.</p>
        </motion.div>

        <div className="contact-methods">
          {contactMethods.map((method, index) => (
            <motion.a
              key={method.name}
              href={method.link}
              target="_blank"
              rel="noopener noreferrer"
              className="contact-card"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <div className={`icon-wrapper ${method.color}`}>
                <span>{method.icon}</span>
              </div>
              <h3>{method.name}</h3>
              <p>{method.description}</p>
            </motion.a>
          ))}
        </div>

        <motion.div
          className="mx-auto max-w-xl"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.3 }}
        >
          <form className="contact-form">
            <div>
              <label htmlFor="name">Name</label>
              <input
                type="text"
                name="name"
                id="name"
                placeholder="Your name"
              />
            </div>
            <div>
              <label htmlFor="email">Email</label>
              <input
                type="email"
                name="email"
                id="email"
                placeholder="your.email@example.com"
              />
            </div>
            <div>
              <label htmlFor="message">Message</label>
              <textarea
                name="message"
                id="message"
                rows={4}
                placeholder="How can we help you?"
              />
            </div>
            <button type="submit">Send Message</button>
          </form>
        </motion.div>
      </div>
    </div>
  );
}

export default Contact;
